import React from 'react';
import { useNavigate } from 'react-router-dom';
import './songs.css';

const Songs = () => {
  const navigate = useNavigate();

  const songs = [
    {
      title: 'Tum Hi Ho',
      videoId: 'Umqb9KENgmk',
      thumbnail: 'https://img.youtube.com/vi/Umqb9KENgmk/default.jpg',
    },
    {
      title: 'Blinding Lights',
      videoId: 'fHI8X4OXluQ',
      thumbnail: 'https://img.youtube.com/vi/fHI8X4OXluQ/default.jpg',
    },
    {
      title: 'Believer',
      videoId: '7wtfhZwyrcc',
      thumbnail: 'https://img.youtube.com/vi/7wtfhZwyrcc/default.jpg',
    },
    {
      title: 'Someone Like You',
      videoId: 'hLQl3WQQoQ0',
      thumbnail: 'https://img.youtube.com/vi/hLQl3WQQoQ0/default.jpg',
    },
  ];

    const handleSongClick = (song) => {
        localStorage.setItem('selectedSong', JSON.stringify(song));
        navigate('/songpage'); // Uses React Router navigation
  };
  const goBack = () => {
        window.history.back();
  };

  return (
    <>
      <header>
        <div className="logo">
          <h1>
            <abbr title="Dua Music Player">DMP</abbr>
          </h1>
        </div>

        <div className="search-bar">
          <input type="text" placeholder="Search music..." />
          <button type="submit">Search</button>
        </div>
      </header>

      <main>
        <button className="back-button" onClick={goBack}>&#8592; Back</button>
        <h2 className="section-title">All Songs</h2>
        <ul className="song-list">
          {songs.map((song, index) => (
            <li
              key={index}
              className="song-item"
              onClick={() => handleSongClick(song)}
            >
              <img src={song.thumbnail} alt={song.title} />
              <span>{song.title}</span>
            </li>
          ))}
        </ul>
      </main>

      <footer>
        <p>&copy; 2025 DMP - Dua Music Player</p>
      </footer>
    </>
  );
};

export default Songs;
